import React from 'react';
import { Link } from 'react-router-dom';


const Menu = () => {
  return (
      <>


<Link to="/">About Us</Link>
<Link>Contact Us</Link>


<a href='/'> About Us</a>
<a href='/contact'> Contact Us</a>


      </>
  )
}

export default Menu;
